import binascii

alphabet = 'abcdefghjiklmnopqrstuvwxyz_{}'

data = binascii.unhexlify('3000050000001031000B00000010320000000000103300060000001034001B000000103500120000001036000E0000001037000D0000001038001A0000001039000E0000001031300005000000103131001A0000001031320000000000103133001A00000010313400010000001031350012000000103136000E000000103137000D000000103138001C0000000000')

plaintext = ''.join([alphabet[ord(x[2] if len(x) == 6 else x[3])] for x in data.split('\x10')])
print(plaintext)


